import PinTweet from '../components/PinTweet'

const PinTweetContainer = (props) => {


    return (
        <div className="tweets">
            {props.tweets.map(tweet => {
                return <PinTweet tweet={tweet} removeTweet={props.removeTweet}/>
            })}
        </div>

    )
}
